import { Container } from "react-bootstrap"
import Cabecalho from "./Cabecalho"
import Menu from "./Menu";

export default function Pagina(props){
    return(
        <Container>
            <Cabecalho titulo="Sistema de Agendamentos de Quadras Esportivas"/>
            <Menu/>
            <Container>
                {props.children}
            </Container>
        </Container>
    );
}
